import { StyleSheet } from 'react-native';

export default StyleSheet.create({
    container: {
        height: '100vh',
        width: '10%',
        backgroundColor: 'black',
        display: 'flex',
        alignItems: 'center',
        paddingTop: '20px',
    },
});
